  <div className="sidenav">
    <div >
        <button className='tabs'><Link to="/" className='linkInBlack'>üè° Home</Link></button>
        <button className='tabs'><Link to="/new" className='linkInBlack'>ü§ù Join Team</Link></button>
        <button className='tabs'><Link to="/explore" className='linkInBlack'>üîç Explore Team</Link></button>
    </div>
  </div>
);

export default SideNav;
